void MOD_mkAudioPipeline::dump_VCD(tVCDDumpType dt,
				   unsigned int levels,
				   MOD_mkAudioPipeline &backing)
{
  vcd_defs(dt, backing);
  vcd_prims(dt, backing);
  if (levels != 1u)
    vcd_submodules(dt, levels - 1u, backing);
}

